import React from 'react';
import './skills.scss';
import {
    FooterContainer,
    LinkOptions
} from './footer.styles'

const Skills = () => (
    <div>
        <FooterContainer >
            <LinkOptions>
                Copyright
            </LinkOptions>
            <LinkOptions>
                Icons
            </LinkOptions>
        </FooterContainer>
    </div>
);

export default Skills;
